change_filament_gcode:
; Change filament gcode begin
{if previous_extruder != next_extruder}

{if enable_prime_tower}
G0 F9000 X{wipe_tower_x[0]} Y{wipe_tower_y[0]}  ; Fast move to wipe tower
{endif}

M104 S{nozzle_temperature[(previous_extruder < 0 ? 0 : previous_extruder)]-30} T{previous_extruder} ;cooldown
T[next_extruder] ; Make the previous extruder park before heating next extruder
{endif}
M109 S{nozzle_temperature[next_extruder]} T[next_extruder]
{if initial_extruder == next_extruder and layer_z == 0}
G1 E5 F2400 ; extra extrude on first use of initial_extruder
{endif}
; Change filament gcode end
